import { domain } from "../API/api";

const pageApi = {
  home: () => {
    return fetch(`${domain}/elearning/v4/home`).then((res) => res.json());
  },
  course: () => {
    return fetch(`${domain}/elearning/v4/courses/`).then((res) => res.json());
  },
  courseDetail: (slug) => {
    return fetch(`${domain}/elearning/v4/courses/`).then((res) => res.json());
  },
};
export default pageApi;
